INSERT INTO `ps_category_lang` VALUES (1,1,1,'Bazowa','','bazowa','','',''),(2,1,1,'Główna','','glowna','','',''),(4,1,1,'Home','','home','','',''),(5,1,1,'audiobooki','Ogromny wybór książek do słuchania w dobrej cenie - Pobierz plik lub zamień w płytę - Codziennie nowe rabaty!','audiobooki','','',''),(6,1,1,'książki','<p>Tysiące książek w niskich cenach! Najnowsze bestsellery,zapowiedzi, recenzje. Sprawdź naszą ofertę!</p>','ksiazki','','',''),(8,1,1,'Dla dzieci','','dla-dzieci','','',''),(17,1,1,'Dla dzieci','Sprawdź najnowsze pozycje z kategorii książek dla dzieci. Zamów bajki i opowiadania dla Twojej pociechy. Skorzystaj z niskich cen.','dla-dzieci','','',''),(18,1,1,'Dla młodzieży','Tu znajdziesz największy wybór tytułów z kategorii  dla młodzieży w doskonałych cenach. Liczne promocje i wyprzedaże.','dla-mlodziezy','','',''),(19,1,1,'Fantastyka','Lista książek przypisanych do kategorii fantastyka,, fantasy,, science fiction.Fantastyka tu znajdziesz największy wybór tytułów z kategorii Fantastyka w doskonałych cenach. Liczne promocje i wyprzedaże.','fantastyka','','',''),(20,1,1,'Literatura piękna','Literatura piękna obca tu znajdziesz największy wybór tytułów z kategorii Literatura piękna obca w doskonałych cenach','literatura-piekna','','',''),(21,1,1,'Kryminał','Literatura sensacyjna tu znajdziesz największy wybór tytułów z kategorii  kryminał,, horror w doskonałych cenach.','kryminal','','',''),(22,1,1,'Podróże','Podróże. Lubisz podróżować,, a na swoim blogu dzielisz się wrażeniami? Niezależnie od tego,, czy piszesz o dalekich,, czy bliskich wyprawach - ta kategoria jest dla Ciebie.','podroze','','',''),(23,1,1,'Psychologia','Psychologia tu znajdziesz największy wybór tytułów z kategorii Psychologia w doskonałych cenach. Liczne promocje i wyprzedaże.','psychologia','','',''),(24,1,1,'Reportaż-literatura faktu','Literatura faktu jest pojęciem dość młodym – powstało bowiem dopiero na przełomie lat dwudziestych i trzydziestych XX wieku, kiedy to w wielu krajach europejskich twórcy literatury zaczęli odwracać się od fikcji i skłaniać w stronę przedstawiania w swoich tekstach rzeczywistych zdarzeń. Do literatury faktu zalicza się także wywiady z ważnymi osobistościami ze świata kultury, polityki czy życia społecznego.Spośród książek zebranych w kategorii literatury faktu każdy, nawet najbardziej wybredny czytelnik wybierze coś dla siebie. Książki te mogą stanowić świetną odskocznię od beletrystyki – udowadniają one bowiem, że prawdziwe życie pisze historie wcale nie gorsze od tych autorstwa twórców literatury pięknej.','reportaz-literatura-faktu','','',''),(25,1,1,'polska','Literatura piękna polska tu znajdziesz największy wybór tytułów z kategorii Literatura piękna polska w doskonałych cenach. ','polska','','',''),(26,1,1,'obca',' Literatura piękna obca tu znajdziesz największy wybór tytułów z kategorii Literatura piękna obca w doskonałych cenach.','obca','','',''),(28,1,1,'reportaż - literatura faktu','','reportaz-literatura-faktu','','','');
